import Select from 'react-select'

const SelectionMenu = () => {
    const options = [
        { value: 'wildfo', label: 'Chocolate' },
        { value: 'strawberry', label: 'Strawberry' },
        { value: 'vanilla', label: 'Vanilla' }
      ]
    return (
        <div className="selection-menu">
            <Select options={options} />
        </div>
    )
}

export default SelectionMenu;
